import React from 'react';
import { Tabs, Tab } from 'react-bootstrap';
import RecentOrders from './RecentOrders'; // Import the RecentOrders component
import AddProductPage from './AddProductPage'; // Import the AddProductPage component

const VendorDashboard = () => {
  return (
    <div>
      <h1>Vendor Dashboard</h1>
      <Tabs defaultActiveKey="orders" id="vendor-dashboard-tabs" className="mb-3">
        {/* Orders Tab */}
        <Tab eventKey="orders" title="Orders">
          <RecentOrders />
        </Tab>

        {/* Add Product Tab */}
        <Tab eventKey="add-product" title="Add Product">
          <AddProductPage />
        </Tab>

        {/* Profile Tab */}
        <Tab eventKey="profile" title="Profile">
          <div>
            <h2>Vendor Profile</h2>
            <p>Update your profile information here.</p>
            {/* Add Profile Editing Component or Form */}
          </div>
        </Tab>
      </Tabs>
    </div>
  );
};

export default VendorDashboard;
